    true,nt"url": null,nt"notes": "&lt;p&gt;The LEARN Project explores the
    creation of novel concepts and processes with the potential to create new capabilities
    in aeronautics research through awards to the external community including university
    and industry teams. The LEARN Project incorporates a competitive review process
    of the external teams&amp;rsquo; proposals to develop integrated solutions for complex
    technical problems captured in the ARMD strategic thrusts, followed by short duration
    activities for feasibility assessment. Follow-on phases of the most promising ideas
    are also funded. LEARN also utilizes challenges and prizes to the external community.&amp;nbsp;
    With these processes, NASA funds also help catalyze investments from the aerospace
    and non-aerospace communities toward solving problems aligned with NASA interests.&lt;/p&gt;&lt;p&gt;The
    NASA Aeronautics Research Institute (NARI) has been established to achieve the LEARN
    Project&amp;rsquo;s goals.&amp;nbsp; NARI will complement other ARMD efforts in
    seeking early-stage innovative concepts applicable to a broad spectrum of aeronautical
    challenges in the nation&amp;rsquo;s air transportation system by sponsoring research
    solicitations and by hosting future competitive challenges. The Institute will coordinate
    these efforts and communicate the outcome of the research conducted to interested
    parties both internal and external to NASA. ARMD&amp;rsquo;s goal is to mature the
    new concepts in order to infuse them into current ARMD research programs, to enable
    new avenues of aeronautics research that are not currently supported by ARMD program
    and project funds, or to achieve practical application by the aeronautics community.&lt;/p&gt;",nt"license_title":
